import styles from './Header.module.css';
import mealjpg from '../assets/meals.jpg'

const Header = () => {
    return (
        <>
            <header className={styles.header}>
                <h1>ReactMeal</h1>
                <button>Cart</button>
            </header>
            <div className={styles.mainImage}>
                <img src={mealjpg}></img>
            </div>
        </>
    );
}

export default Header;
